"text-align:center;\">21 Feb 45<br> Marseilles<br></h1><h2>\u00a0At 1045 hrs the convoy docked at MARSEILLE. At 1330 hrs all personnel disembarked and were transported to CP3 DBS Staging Area MR T 4133. Tanks were unloaded from shipboard immediately the ships docked. At 1500 hrs the remainder of the regts tanks were loaded on flat cars at MARSEILLE. At 2315 hrs 18 tanks and crews under Major H.R.S. Ellis moved off for their destination.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [4.9334625, 44.9125048], "popup": {"text": "<h1  style=\"text-align:center;\">24 Feb 45<br> Valence-Grenable<br></h1><h2>The route for today is Highway 8 to AIX then north on Highway 7 to area ST LAMBERT. At 0630 hrs the convoy crossed the SP and the wheeled vehicles of the regt started on their trip northward through FRANCE.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [4.8215298, 47.0272332], "popup": {"text": "<h1  style=\"text-align:center;\">25 Feb 45<br> Beaune Evian<br></h1><h2>The route for today is north on Highway 7 to LYON then north on Highway 6 to area MACON.\u00a0</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [3.5408654, 47.7939417], "popup": {"text": "<h1  style=\"text-align:center;\">26 Feb 45<br> AUXERRE-DIJON<br></h1><h2>The route for today is north on Highway 6 to CHAGNY then north on Highway 74 to DIJON then northwest on Highway 5 to area MARMAGNE. At 0200 hrs the last group of tanks arrived at ROULERS.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [3.3200203, 48.5352233], "popup": {"text": "<h1  style=\"text-align:center;\">27 Feb 45<br> BOIS DE VILLEFERMAY<br></h1><h2>The route for today is northwest on Highway 5 to PAMFOU then Highway GC 12 to area BOIS DE VILLEFERMAY. The convoy moved off on the fourth lap of the journey crossing the SP at 0730 hrs. Today the leave allotment for troops of Exercise \"GOLDFLAKE\" came in. It allowed for 7 officers and 76 ORs from the regt to proceed on 9 days leave to the UK. The convoy arrived at the staging area MR X4399 at 1415 hrs. Distance travelled today 112 miles.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [2.7472903, 50.2893004], "popup": {"text": "<h1  style=\"text-align:center;\">28 Feb 45<br> ARRAS-MEZIERES<br></h1><h2>The route for today is north on Highway GC 67 to ROZAY then west on Highway 304 to FORTENA then north on Highway 330 to SENLIO then north on Highway 17 to LE POTEAU then Highway 32 to HAM then northeast on Highway 30 to ST QUENTIN then north to Highway 44 to Highway 17 and on to CAMBRDI then west on Highway 342 to staging area on Highway between ST VAAST and SALESMIS MR N9586. The convoy moved off at 0720 hrs on the fifth lap of their journey crossing the SP at 0720 hrs. At 1700 hrs the head of the column arrived at the staging area and by 1730 hrs all vehicles were parked for the night. Distance travelled today 148 miles.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [3.0790093, 50.9405299], "popup": {"text": "<h1  style=\"text-align:center;\">01 Mar 45<br> Roulers, BE<br></h1><h2>The route for today is E on highway 342 to SOLESMES then N on highway 358 to VALENCIENNES then N on highway 45 to ST AMAND then NW on highway 57 to ROULERS.  Today the personnel of the regt are busy doing maintenance on their vehicles as the wheeled vehicles have travelled approx 1100 miles since leaving CERVIA. Spent a month in place training.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [5.86723198185527, 51.7670337154792], "popup": {"text": "<h1  style=\"text-align:center;\">31 Mar 45<br> MOLENHOEK<br></h1><h2>At 0630 hrs the wheeled convoy moved off from the Groot Market, ROULERS on the trek to HOLLAND. The head of the convoy crossed the start point at 0810 hrs. The convoy went very well all day, arriving at the DP E681607 at 1700 hrs where a guide met the convoy and directed it to the concentration area in MOLENHOEK MR 711537. The route for today was North to GHENT, then East to ANTWERP, TILBURG, HERTOGENBOSCH, GRAVES to DP at HEES. On arrival at MOLENHOEK the vehicles were quickly dispersed and camouflaged in the areas laid on by the recce advance party.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [6.139612, 51.976832], "popup": {"text": "<h1  style=\"text-align:center;\">12 Apr 45<br> WEHL<br></h1><h2>The route to the concentration area is SP (ROR - MOOK-GENNEP-road 8348- road at MATTERBORN 8853 - CLEVE - MAPLE LEAF up to EMMERICH BRIDGE - to ELTON (Bde DP)- BEEK - KILDER to WEHL (9376).</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [5.913696, 52.000944], "popup": {"text": "<h1  style=\"text-align:center;\">14 Apr 45<br> Arnhem<br></h1><h2>At 1330 hrs Lt-col J.W. Eaton attended an O Gp at 5 Cdn Armd Bde when Brigadier I.H. Cumberland OBE, ED issued orders that 5 Cdn Armd Bde will be attacking at first tank light (approx 0630 hrs) 15 Apr 45. The general plan is: The 5 Cdn Armd Div will advance diagonally across Holland to the ZUIDER ZEE, the 5 Cdn Armd Bde will advance to the ZUIDER ZEE in 5 phases, two regts up. The 8NBH on the left and the BCDs on the right.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [5.639747, 52.101411], "popup": {"text": "<h1  style=\"text-align:center;\">16 Apr 45<br> Meulunteren<br></h1><h2>The regt would advance one up \"B\" Sqn leading followed by RHQ and \"A\" Sqn. \"C\" Sqn to push on when they were replemished. The objective for the day was PLUMBER (high ground at 5790).\u00a0</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [5.609008, 52.229], "popup": {"text": "<h1  style=\"text-align:center;\">17 Apr 45<br> Putten<br></h1><h2>\u00a0Orders were then issued as follows: \"A\" Sqn with \"A\" Coy Westminster Regt (M) were to work their way forward to BOWL (PUTTEN) and to firm up there, the advance moving off at 2100 hrs. The column continued to advance until 2130 hrs when they ran into an ambush of some 50 bazookas supported by SPs firing AP and HE. They were only able to retire from this ambush after a very heavy fight.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [5.6109362, 52.25683], "popup": {"text": "<h1  style=\"text-align:center;\">18 Apr 45<br> Putten<br></h1><h2>1 Coy of the Westminster Regt (M) will cut the rd at 533087, 1 Coy to cut the road at 539091, \"B\" Sqn to pass through the coy of Westminster Regt (M) at 533087 and go north to rd 5309 and firm up there with the coy of Westminster Regt (M) at 539091. \"C\" Sqn will firm up with 1 Coy of Westminster Regt (M) at objective 526088. Recce Tp to recce our rd to ZUIDER ZEE then the lateral rds to the north and south and return to BOWL. Recce Tp achieved the honour of being the first Canadians to reach the ZUIDER ZEE and so cut Holland completely into 2 sections. </h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [6.568044, 52.995278], "popup": {"text": "<h1  style=\"text-align:center;\">22 Apr 45<br> Kloosterveen<br></h1><h2>A shortage of maps is keenly felt. None being available at higher formation HQ. The long move was completed at 0945 hrs for a distance of 176.4 miles in 8 hrs 45 minutes from the start line. The tanks which began to move at 0700 hrs did not arrive until 0115 hrs 23 Apr 45  The 5 Cdn Armd Div is taking over the area from 3 Cdn Inf Div who are supposed to have cleared and mopped up the area. However such is not the case and a formidable pocket still remains in the DELFZIJL (4626) APPINGEDAM (4126) area. </h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [6.567779, 53.149955], "popup": {"text": "<h1  style=\"text-align:center;\">01 May 45<br> Eelde<br></h1><h2>One troop was moved to 488234 and were engaged with a shoot on WEIWERD (4724). The troop at HEVESKES (4824) were also engaged on a shoot. The remainder of the day was spent in preparing for the final assault on DELFZIJL the following morning. 02 May: The tanks moved forward at first light and supported the Irish Regiment in their assault. The Squadron knocked out 2 guns in area (468253) and(465254). One troop remained at HEVESKES (4824) the remainder of the squadron continuing the advance. The attack was successful and the garrison surrendered.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [6.567779, 53.249955], "popup": {"text": "<h1  style=\"text-align:center;\">05 May 45<br> Eelde<br></h1><h2>\u00a0At 2230 hrs the long awaited for message was received from rear 5 Cdn Arnd Bde, \"Cancel all offensive operations, cease fire at 0800 hrs 5 May 45\"  The jubilation of the Dutch people was tremendous and celebrations took place all day. A service was held in the EELDE (215048) protestant church.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [6.567779, 53.219955], "popup": {"text": "<h1  style=\"text-align:center;\">08 May 45<br> Eelde<br></h1><h2>The joyous news was heard over the BBC that 8 May 1945 was \"V\" E Day. The regiment celebrated.</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addMarker", [{"lngLat": [6.567779, 53.149955], "popup": {"text": "<h1  style=\"text-align:center;\">23 May 45<br> Eelde<br></h1><h2>The GOC in C, First Cdn Army, General H.D.G. Crerar accompanied by the two corps commanders and our own GOC Major-General B.M. Hoffmeister inspected the 5 Cdn Armd Div. Following the inspection, on order by the GOC, 5 Cdn Armd Div, three \"armoured cheers\" was given by the division; motors, horns and syrens made a terrific noise. During the afternoon the march past took place. The tanks and wheeled vehicles moved two abreast past General Crerar who took the salute, a very impressive sight lasting over 3 hrs.\u00a0</h2>", "options": {}}, "options": {"draggable": true, "color": "red", "tooltip": "Hey, Fred"}}]], ["addSource", ["trace", {"type": "geojson", "data": {"type": "Feature", "geometry": {"type": "LineString", "coordinates": [[5.36932, 43.29283]]}}}]], ["addLayer", [{"id": "trace", "type": "line", "paint": {"line-color": "red", "line-opacity": 0.75, "line-width": 5}, "source": "trace"}, null]], ["setLayoutProperty", ["trace", "visibility", "visible"]], ["setPaintProperty", ["trace", "line-opacity", 1.0]], ["setPitch", [60]], ["addLayer", [{"id": "blocks-line", "type": "line", "paint": {"line-color": "red", "line-width": 4}, "source": {"data": {"type": "FeatureCollection", "features": [{"id": "0", "type": "Feature", "properties": {}, "geometry": {"type": "LineString", "coordinates": [[5.36932, 43.29283], [5.37005, 43.29295], [5.37005, 43.29297], [5.37063, 43.293], [5.37115, 43.29313], [5.37108, 43.29327], [5.371, 43.29325], [5.37098, 43.29329], [5.37112, 43.29332], [5.37125, 43.29339], [5.37127, 43.29335], [5.37128, 43.29332], [5.3713, 43.29329], [5.3715, 43.29331], [5.37152, 43.29332], [5.37154, 43.29332], [5.37162, 43.29334], [5.37163, 43.29335], [5.37166, 43.29337], [5.37171, 43.29341], [5.37172, 43.29341], [5.37227, 43.29355], [5.37278, 43.29368], [5.37282, 43.29369], [5.3
